import React, { useEffect, useState } from "react";
import { Form, Field } from 'react-final-form';
import styles from "./final_form.module.css";
import btn from "../../stylesheets/btn.module.css";

const onSubmit = async (values) => {
  try {
    const response = await fetch('/submit-form', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(values),
    });

    if (response.ok) {
      console.log('Form data submitted successfully');
      // Можете добавить здесь код для обновления состояния компонента или отображения сообщения об успешной отправке.
    }
  } catch (error) {
    console.error('Error submitting form data:', error);
  }
};

const loadDataFromServer = async () => {
  try {
    const response = await fetch('/get-data');

    if (response.ok) {
      const data = await response.json();
      console.log('Data received from the server:', data);
      // Можете добавить здесь код для обновления состояния компонента и отображения полученных данных.
    }
  } catch (error) {
    console.error('Error getting data from the server:', error);
  }
};

const FinalForm = () => {
  useEffect(() => {
    // Вызовите функцию loadDataFromServer, чтобы получить данные с сервера при загрузке компонента.
    loadDataFromServer();
  }, []);

  return (
    <Form
      onSubmit={onSubmit}
      render={({ handleSubmit }) => (
        <div className={styles.wrapper}>
          <form onSubmit={handleSubmit} className={styles.form}>
            <h2>Final Form</h2>

            <div className={styles.section}>
              <Field name="firstName" validate={required}>
                {({ input, meta }) => (
                  <label className={styles.label}>
                    <input {...input} type="text" className={styles.input} placeholder="Name" />
                    {meta.touched && meta.error && <span className={styles.error}>{meta.error}</span>}
                  </label>
                )}
              </Field>

              <Field name="surname" validate={required}>
                {({ input, meta }) => (
                  <label className={styles.label}>
                    <input {...input} className={styles.input} placeholder="Surname" />
                    { meta.touched && meta.error && <span className={styles.error}>{meta.error}</span> }
                  </label>
                )}
              </Field>
            </div>

            <div className={styles.section}>
              <Field name="phone" validate={composeValidators(required, mustBeNumber)}>
                {({ input, meta }) => (
                  <label className={styles.label}>
                    <input {...input} className={styles.input}  placeholder="Phone" />
                    {meta.touched && meta.error && <span className={styles.error}>{meta.error}</span>}
                  </label>
                )}
              </Field>

              <Field name="email" validate={validEmail}>
                {({ input, meta }) => (
                  <label className={styles.label}>
                    <input {...input} className={styles.input} placeholder="Email"/>
                    {meta.touched && meta.error && <span className={styles.error}>{meta.error}</span>}
                  </label>
                )}
              </Field>
            </div>

            <Field name="howDidYouHearAboutMe" validate={maxLength(110)}>
              {({ input, meta }) => (
                <label className={styles.label}>
                  <textarea {...input} className={styles.input} type="text" placeholder="How did you hear about me?" rows="2" />
                  {meta.touched && meta.error && <span className={styles.error}>{meta.error}</span>}
                </label>
              )}
            </Field>

            <Field name="howICanAssistYou" validate={maxLength(350)}>
              {({ input, meta }) => (
                <label className={styles.label}>
                  <textarea {...input} className={styles.input} type="text" placeholder="How I can assist you?" rows="5"/>
                  {meta.touched && meta.error && <span className={styles.error}>{meta.error}</span>}
                </label>
              )}
            </Field>

            <button type="submit" className={btn.secondary}>Send</button>
          </form>
        </div>
      )}
    />
  );
};

export default FinalForm;
